import React from 'react';
import s from './Friend.module.css'

const Friend = (props) => {

    return (

        <div className={s.friend}>
            <img className={s.image} src={props.image}/>
            <div className={s.friendName}>{props.name}</div>
        </div>


    );
};

export default Friend;
